def get_f(alpha, v1, v2, side):
    '''
    alpha   Number  significance level
    v1      Number  degree of freedom #1
    v2      Number  degree of freedom #2
    side    String  "upper"  upper value of F distribution
                    "lower"  lower value of F distribution
                    "both"   upper and lower values of F distribution

    must specifiy side because F distribution is asymmetrical

    returns specified value(s) of F distribution
    '''
    if side == "upper":
        return get_f_upper(alpha, v1, v2)
    elif side == "lower":
        return get_f_lower(alpha, v1, v2)
    elif side == "both":
        return (get_f_lower(alpha / 2, v1, v2), get_f_upper(alpha / 2, v1, v2))
    else:
        print("Error: side must be one of 'upper', 'lower', 'both'")

def get_f_upper(alpha, v1, v2):
    '''
    alpha   Number  significance level
    v1      Number  degree of freedom #1
    v2      Number  degree of freedom #2

    returns upper value of F distribution
    '''
    if v1_in_table(v1) and v2_in_table(v2):
        i = get_i(v1)
        j = get_j(v2)
        return read_table(alpha, i, j)

    elif not v1_in_table(v1) and v2_in_table(v2):
        i_1 = get_new_i(v1)[0]
        i_2 = get_new_i(v1)[1]
        j = get_j(v2)
        return (read_table(alpha, i_1, j) + read_table(alpha, i_2, j)) / 2

    elif v1_in_table(v1) and not v2_in_table(v2):
        i = get_i(v1)
        j_1 = get_new_j(v2)[0]
        j_2 = get_new_j(v2)[1]
        return (read_table(alpha, i, j_1) + read_table(alpha, i, j_2)) / 2
    else:
        i_1 = get_new_i(v1)[0]
        i_2 = get_new_i(v1)[1]
        j_1 = get_new_j(v2)[0]
        j_2 = get_new_j(v2)[1]
        return (read_table(alpha, i_1, j_1) + read_table(alpha, i_1, j_2) + read_table(alpha, i_2, j_1) + read_table(alpha, i_2, j_2)) / 4

def v1_in_table(v1):
    return (1 <= v1 <= 10) or (v1 == 12) or (v1 == 15) or (v1 == 20) or (v1 == 24) or (v1 == 30) or (v1 == 40) or (v1 == 60) or (v1 == 120)

def v2_in_table(v2):
    return (1 <= v2 <= 30) or (v2 == 40) or (v2 == 60) or (v2 == 120)

def read_table(alpha, i, j):
    if alpha == .1:
        return a1[i][j]
    elif alpha == .05:
        return a05[i][j]
    elif alpha == .025:
        return a025[i][j]
    elif alpha == .01:
        return a01[i][j]
    elif alpha == .005:
        return a005[i][j]
    else:
        print("Invalid Request")

